import React, { useState } from "react";
import { HamburguerMenu } from "../../styledComponents/HamburguerMenu";
import { StyledButton } from "../../styledComponents/StyledButton";
// import { ResumeButton as Button } from "../button/StyledButton";
import { StyledNavbar } from "./StyledNavbar";

export const Navbar: React.FC = () => {
  const [openMobileNav, setOpenMobileNav] = useState(false)
  console.log(openMobileNav)
  const toggleNav = ()=> setOpenMobileNav(!openMobileNav)
  return (
    <StyledNavbar>
      <h3>Tomas Sadone</h3>
      <HamburguerMenu onClick={toggleNav} className="hamburguer">
        <div className="open">
        <span />
        </div>
      </HamburguerMenu>
      <div className="navigation">
        <span>WORK</span>
        <span>ABOUT</span>
        <span>CONTACT</span>
        <StyledButton
          className="styled-button"
          background="#1A1A1A"
          padding="0.875em"
        >
          RESUME
        </StyledButton>
      </div>
    </StyledNavbar>
  );
};
